# Minimum Sum of Mountain Triplets II


class Solution:
    def threeSum(self, nums):
        dct = dict()
        for i in range(len(nums)):
            for j in range(len(nums)):
                if i != j:
                    dct[(nums[i]+nums[j])*-1] = [nums[i],nums[j]]

        [print(k,dct[k]) for k in dct]
        res = list()
        for k in dct:
            if k in nums:
                res.append(dct[k].append(k))
        return res
s = Solution()
